import React, { Component } from "react"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"
import { connect } from "react-redux"
import './App.css';
import 'antd/dist/antd.css';
import Resgister from "./pages/Resgister"
import Home from "./../src/Manage/Home"
import LiveChat from './../src/Manage/LiveChat'
class App extends Component {

  render() {
    const { member = {} } = this.props
    const { isUserLoggedIn } = member
    return (
      <Router>
        <Switch>

          {isUserLoggedIn ? (
            <Route path="/" component={Home} />
          ) : (<Route exact path="/" component={Resgister} />)
          }
          {isUserLoggedIn ? (<Route path="/" component={LiveChat} />) : null}
          <Route component={Resgister} />
        </Switch>
      </Router>

    );
  }
}
